import React from 'react';
import {Link} from 'react-router-dom'

function LinkHome (props) {
  return (
    <div
      className={route==="/Home" ? "linkLayout linkLayout--active" : "linkLayout"}>
      <Link
        className="link"
        onClick={props.changeRouteHome}
      >
        Главная
      </Link>
    </div>
  )
}

export default LinkHome
